def tweets_per_second_old(tps, k):
    q = []
    prevmax = -1
    for v in tps:
      q.append(v)
      removed = q.pop(0) if len(q) > k else -1
      prevmax = max(q) if removed == prevmax else max(v,prevmax)
      print(prevmax)

def tweets_per_second(tps, k):
    tail = 0
    removed = -1
    prevmax = tps[0]
    maxidx = 0
    for head,v in enumerate(tps):
      # slide window
      if head - tail == k:
        removed = tps[tail]
        tail += 1
      # new value is bigger than anything else in window
      if v >= prevmax:
        maxidx = head
        prevmax = v
      # we've just poped out previous maximum value, calc new one
      elif v < prevmax and removed == prevmax:
          slice = tps[tail:head+1]
          prevmax = max(slice)
          maxidx = slice.index(prevmax)
      print(prevmax)




